import React from "react";
import MatchPanel from "../../components/matchPanel";

export default function ContentTeam({ type, data }) {
    return (
        <div className={"lg:px-20 py-5"}>
            {type === "results" &&
                <div>
                    <MatchPanel headline={"Výsledky"}></MatchPanel>
                </div>
            }
            {type === "program" && <p>Zde bude program zápasů.</p>}
            {type === "lineUp" && <p>Zde bude soupiska týmu.</p>}
        </div>
    );
}
